import React from 'react';
import './App.css';
import background_image from './b1.jpg';

function App() {
  return (
    <div styles={{ backgroundImage:`url(${background_image})`, backgroundPosition: 'center', backgroundSize: 'cover', backgroundRepeat: 'no-repeat' }}>
    </div>
  );
}

export default App;
